import React from 'react';
import { Dropdown, DropdownButton, Item} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import './Suppression.css';

function Modal() {
            return (
            <div className="Modal">
            <DropdownButton id="dropdown-basic-button" title="Dropdown button">
                    <Dropdown.Item href="#/action-1">Create Suppression List</Dropdown.Item>
                    <Dropdown.Item href="#/action-2">Add Suppression Email</Dropdown.Item>
                    <Dropdown.Item href="#/action-3">Remove Suppression Email</Dropdown.Item>
            </DropdownButton>
            </div>
            );
          }
export default Modal
